import React from "react";
import "./Modal.css";

function Modal({ setModalOpen, data, key }) {
  return (
    <div className=".modalDetails">
      <button onClick={() => setShowModal(false)}>Chiudi</button>
      <h1>{key === data.id ? data.id : data.firstName}</h1>
    </div>
  );
}

export default Modal;
